	private static Logger logger = LoggerFactory.getLogger(ROAOCPVCreateWorkItemServiceImpl.class);

	@Override
	public JSONObject workitem(JSONObject jsonObject) throws IOException {

		JSONObject sendAuthenticateResponse = new JSONObject();

		try {
			GenerateProperty x = GenerateProperty.getInstance();
			x.bypassssl();
			// Create all-trusting host name verifier
			HostnameVerifier allHostsValid = new HostnameVerifier() {
				public boolean verify(String hostname, SSLSession session) {
					return true;
				}
			};

			HttpsURLConnection.setDefaultHostnameVerifier(allHostsValid);
			URL url = new URL(x.BASEURLV2 + "customer/workItem?api_key=" + x.api_key);
			// URL url = new
			// URL("https://intramashery.suryodaybank.co.in/customer/workItem?api_key=kyqak5muymxcrjhc5q57vz9v");
			HttpURLConnection httpConn = (HttpURLConnection) url.openConnection();
			httpConn.setRequestMethod("POST");

			httpConn.setRequestProperty("Content-Type", "application/json");

			httpConn.setDoOutput(true);
			OutputStreamWriter writer = new OutputStreamWriter(httpConn.getOutputStream());
			writer.write(getHardCodeValue().toString());
			writer.flush();
			writer.close();
			httpConn.getOutputStream().close();

			InputStream responseStream = httpConn.getResponseCode() / 100 == 2 ? httpConn.getInputStream()
					: httpConn.getErrorStream();
			try (Scanner s = new Scanner(responseStream).useDelimiter("\\A")) {
				String response = s.hasNext() ? s.next() : "";
				sendAuthenticateResponse = new JSONObject(response);
				return sendAuthenticateResponse;
			}

		} catch (Exception e) {
			// TODO: handle exception
		}

		logger.debug("Service END here");
		return sendAuthenticateResponse;
	}

